import React from "react";

class Logo extends React.Component {
  render() {
    return (
      <div>
        <img
          style={{
            width: "100px",
            marginLeft: "30px"
          }}
          src={require("./logo.png")}
          alt="logo sneakerBis home"
        />
      </div>
    );
  }
}

export default Logo;
